import React from 'react';

interface IntroProps {
  onEnd: () => void;
}


export const Intro: React.FC<IntroProps> = ({ onEnd }) => {
  return (
    <div className="flex flex-col items-center justify-center w-full h-full">
      <h1 className="text-2xl mb-5">Welcome to My Game!</h1>
      <div
        className="h-1 bg-blue-500 transition-all duration-5000 ease-linear w-0"
        style={{ width: '100%' }}
        onTransitionEnd={onEnd}
      ></div>
    </div>
  );
};
